   <li><em class="gem">los c&oacute;digos decimal y hex para utilizar en el <mark>html</mark>,</em></li>
   <li><em class="gem">el codigo hex para utilizar con los pseudoselectores <code>:before</code> y <code>:after</code> en el <mark>css</mark></em></li>
   <li><em class="gem">el codigo para utilizar en los <mark>output de javaScript</mark>.</em></li>
</ul>

</div>
<div class="large-3 large-uncentered small-6 small-centered  columns"><img src="images/glyphs.png" alt="glyphs" class="th radius" /></div>
