<h4>HTML</h4>
<p>En el <code>html</code>, adem&aacute;s del nombre mnemot&eacute;cnico (&nbsp;<code>&amp;oacute;</code>&nbsp;) podemos utilizar los c&oacute;digos num&eacute;ricos decimal (&nbsp;<code>&amp;&#35;243;</code>&nbsp;) i hex (&nbsp;<code>&amp;&#35;xf3;</code>&nbsp;).<br />
De hecho no todos los s&iacute;mbolos tienen un nombre mnemot&eacute;cnico, por lo cual es importante conocer las otras opciones.</p>

<div class="large-12 g_panel html">
<article>
<pre><code class="language-markup">
&lt;p>Atenci&amp;oacute;</span>n! Aqu&amp;iacute; viene el cami&amp;oacute;n&lt;/p>
&lt;p>Atenci&amp;#243;</span>n! Aqu&amp;#237; viene el cami&amp;#243;n&lt;/p>
&lt;p>Atenci&amp;#xf3;</span>n! Aqu&amp;#xed; viene el cami&amp;#xf3;n&lt;/p>
</code></pre></article></div>

<h4>CSS</h4>
<p>Podemos generar contenido en el <code>CSS</code> utilizando los pseudo-elementos <code>:before</code>  <em class="gem">(antes de)</em> y <code>:after</code> <em class="gem">(despu&eacute;s de)</em>.</p>
<!--<p>M&aacute;s sobre <code>:before</code> y <code>:after</code>.</p>-->
<p><strong>&iquest;Pero qu&eacute; pasa si queremos insertar texto con diacr&iacute;ticos o s&iacute;mbolos?</strong><br />
Pr&aacute;cticamente podemos insertar cualquier car&aacute;cter especial, y para insertarlo escribiremos el c&oacute;digo hexadecimal precedido por el car&aacute;cter de escape ( <strong>\</strong> ) as&iacute;:</p>

<div class="large-12 g_panel css">
        <article>								
		        <pre><code class="language-css">p:before{content: "Atenci\0f3n";color:#d14;}</code></pre>
        </article>
</div>  
<h4>JavaScript</h4>
<p><strong>&iquest;Como podemos sacar s&iacute;mbolos <!--<abbr title="American Standard Code for Information Interchange">ASCII</abbr>--> en el <em class="gem">output</em> de JavaScript?</strong><br />Para incluir s&iacute;mbolos en los <em class="gem">output</em> de javaScript (<code>alert()</code>, <code>confirm()</code>, <code>prompt()</code>) tenemos que utilizar el codigo hexadecimal del s&iacute;mbolo: </p>
<div class="large-12 g_panel html">
        <article>
                <pre><code class="language-markup"><a href="glyphs.php#" onClick="confirm('\241Atenci\363n! Peligro.')">
SIGUE ESTE ENLACE Y COMPARTELO!
</a></code></pre>
        </article>
</div>
       <div>
       <p class="demo"><a href="javascript:void(0)" onClick="confirm('\241Atenci\363n! Peligro.')">SIGUE ESTE ENLACE Y COMPARTELO!</a></p>
       </div>
       <p>En lo que concierne <code>document.write()</code> y <code>document.writeln()</code> tenemos varias posibilidades:</p>
       
<blockquote><pre>
document.write ( '<span class="str">\241</span>Atenc<span class="str">i\3631</span>n!' ) ;
document.write ( '<span class="str">&amp;#161;</span>Atenci<span class="str">&amp;#243;</span>n!' ) ;
document.write ( '<span class="str">&amp;#xa1;</span>Atenci<span class="str">&amp;#xf3;</span>n!' ) ;
document.write ( '<span class="str">&amp;iexcl;</span>Atenci<span class="str">&amp;oacute;</span>n!' );						
</pre></blockquote>
  
      
       
