  <script>$(document).ready(function() {
  $('td.glyphsDetails').click(function(e) {
    var elementToGet = '#div' + $(this).data('tip-source');
    var newHTML = $(elementToGet).html();
    $('#glyphsDetails_container').html(newHTML);
    var glyphsDetailsWidth = $('#glyphsDetails_container').outerWidth();
    var positionTop = $(this).position().top + 20;
    if ($(this).hasClass('rightSide')) {
      var positionLeft = $(this).position().left - glyphsDetailsWidth + 30
    } else {
      var positionLeft = $(this).position().left + 30
    }
    $('#glyphsDetails_container').css('left', positionLeft + 'px');
    $('#glyphsDetails_container').css('top', positionTop + 'px');
    $('#glyphsDetails_container').css({
      'display': 'block',
      'opacity': '0'
    }).animate({
      opacity: 1
    }, 250)
  });
  $('#glyphsDetails_container').click(function() {
    $('#glyphsDetails_container').animate({
      opacity: 0
    }, 250, function() {
      $('#glyphsDetails_container').css('display', 'none').html('')
    })
  })
});</script><script>

</script>
